class Solution {
    func findHighAccessEmployees(_ access_times: [[String]]) -> [String] {
        var accessLog = [String: [Int]]()

        for access in access_times {
            let name = access[0]
            let time = Int(access[1])!
            if accessLog[name] != nil {
                accessLog[name]!.append(time)
            } else {
                accessLog[name] = [time]
            }
        }

        var result = [String]()

        for (name, times) in accessLog {
            let sortedTimes = times.sorted()
            for i in 0..<sortedTimes.count {
                var count = 1
                for j in (i + 1)..<sortedTimes.count {
                    if sortedTimes[j] - sortedTimes[i] < 100 {
                        count += 1
                    } else if sortedTimes[j] / 100 == sortedTimes[i] / 100 && sortedTimes[j] % 100 - sortedTimes[i] % 100 <= 59 {
                        count += 1
                    } else {
                        break
                    }
                }
                if count >= 3 {
                    result.append(name)
                    break
                }
            }
        }

        return result
    }
}
